function Nav() {

    const navBarStyle = () => {
        return {
        backgroundColor: 'white',
        color: 'black',
        }
    };

  return (
    <div className="navContainer" style= {navBarStyle}>
        <ul>
            <li>Home</li>
            <li>About Me</li>
            <li>Portfolio</li>
            <li>Resume</li>
        </ul>
    </div>
  );
}

export default Nav;
